import {useState} from 'react';
import './TableRow.css'
const TableRow = ({ user, showInfo }) => (

        <div className="TableRowWrapper">
            <span className="TableRowName">{user.name}</span>
            <span className="TableRowGrade">{user.grade}</span>
            <span className="TableRowDetail" onClick={showInfo}><div className="pointRight"></div></span>
        </div>
)


export default TableRow
